-eq 0 ]; then\nzip -R -y \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" \"lib/*.a\"\nzip -r -y \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" \"resources\" \"include\" -x@zip_exclude.lst\n#zip \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" .packageid\nfi\n\nif [ $SCRIPT_OPTIONS = \"MOVE_FILE\" ]; then\n    BUILT_ZIP=\"${PROJECT_DIR}/$LIBRARY_ARCHIVE\"\n    NEW_ZIP=\"$DEST_DIR/$LIBRARY_ARCHIVE\"\n\n    if [ $current_style = \"Debug\" ]; then\n        OLD_FOLDER=\"$DEST_DIR/$TARGET-${current_style}\"\n    else  \n        OLD_FOLDER=\"$DEST_DIR/$TARGET\"\n    fi\n    rm -rf $OLD_FOLDER\n    mv $BUILT_ZIP $DEST_DIR/\n    unzip -o $NEW_ZIP -d $OLD_FOLDER/\n    rm -f $NEW_ZIP\nfi\n\ndone";
